const initialState = {
    color: 'red',
    number: 0
};

export default function counter(state = initialState, action) {
    switch (action.type) {
        case CHANGE_COLOR:
            return {
                ...state,
                color: action.color
            };
        case INCREMENT:
            return {
                ...state,
                number: state.number + 1
            };
        case DECREMENT:
            return {
                ...state,
                number: state.number - 1
            };
        default:
            return state;
    }
}

